import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Power from './components/Power';
import Comms from './components/Comms';
import Drivetrain from './components/Drivetrain';


const App = () => {

  return (
    <div className="container mt-4" style={{ backgroundColor: 'black', color: 'white' }}>
        <div className="row">
          <div className="col-md-6"> Power
            <Power/>
          </div>
          <div className="col-md-6"> Comms
            <Comms/>
          </div>
          <div className="col-md-6"> Drivetrain
            <Drivetrain/>
          </div>
        </div>
      </div>
  );
};

export default App;
